  "fixed_xml": "<ITEM>Ar. P. Paupie, Buchhändler in Haag, hat dermalen die fanften Tomes des <BIBL><TITLE>Lettres Juives</TITLE></BIBL> bereits fertig, und den Sechsten unter der Presse, welche denen Schweizerischen Herren Subscribenten in diesem Monath ausgeliefert werden sollen. Dieses Werk wird die Losaner-Edition weit übertreffen; Insofern es nicht nur mit mehrerer Materie sondern auch mit einer Anzahl von dem Discipulo des berühmten Piccard verfertigten Kupferstichen angefüllt und ausgezieret ist. Zu noch weiterer Begünstigung der Herren Präenumeranten offeriert Herr Paupie zu gleicher Zeit zwei Tomes des <BIBL><TITLE>Lettres Cabalistiques</TITLE></BIBL> um <PRIZE>24. sols oder 12. Schweizer-Batzen</PRIZE> zu kaufen, und den Subscriptions-Termin dieser zwei Werke bis zum Ende des nächsten bevorstehenden Monats Juni zu verlängern. Das Weitere kann aus dem in allhiesigem Bericht-Hause liegenden Project und Aviso ersehen, und dahin auch die Präenumerationen eingesandt werden. So kann auch allda subscribiert werden auf ein unvergleichliches Werklein von nemlicher Edition, genandt: <BIBL><TITLE>Traité de la Religion naturelle & révélée</TITLE></BIBL>, aus dem Englischen übersetzt; man zahlt zum Voraus <PRIZE>5. Bz.</PRIZE> und bei Auslieferung des ersten Theils in dem nächsten Maymonath <PRIZE>10. Bz.</PRIZE></ITEM>",
